class Jogada {

    dados;
    turno;

    setDados(dados) {
        this.dados = dados;
    }
    getDados() {
        return this.dados;
    }

    setTurno(turno) {
        this.turno = turno;
    }
    getTurno() {
        return this.turno;
    }

    jogar() {
        dados.map(j => {
            do {
                j.jogarDado();
            } while(j.getNumero() <= 0);
        })
    }

}

export default Jogada;
